import { MantineProvider, Paper, Text, Button } from "@mantine/core";

export default function App() {
  return (
    <MantineProvider
      theme={{
        colorScheme: "dark",
      }}
    >
      <Paper>
        <Text>Hello, world!</Text>
      </Paper>
      <MantineProvider theme={{ fontFamily: "Open Sans" }}>
        <Paper>
          <Text>Hello, world!</Text>
        </Paper>
        <Button>My app button</Button>
      </MantineProvider>
    </MantineProvider>
  );
}
